// Core
import React from "react";

// Begin Component
// __________________________________________________________________________________________

/**
 *
 * Icons/Custom/DharmaLaxalt.tsx
 * @author Peter Laxalt
 * @description Arrow icon.
 *
 */
const DharmaLaxalt: React.FunctionComponent = () => (
  <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 215.21 173.21">
    <defs>
      <style
        dangerouslySetInnerHTML={{
          __html: `
          .cls-1 {
            font-size: 173.56px;
            font-family: DharmaGothicC-ExBold, Dharma Gothic C;
            font-weight: 700;
            letter-spacing: 0em;
          }

          .cls-2 {
            letter-spacing: 0.01em;
          }

          .cls-3 {
            letter-spacing: 0.03em;
          }`,
        }}
      />
    </defs>
    <g>
      <g>
        <text className="cls-1" transform="translate(0 147.53)">
          LAXA
          <tspan className="cls-2" x="155.16" y="0">
            L
          </tspan>
          <tspan className="cls-3" x="182.24" y="0">
            T
          </tspan>
        </text>
      </g>
    </g>
  </svg>
);

export default DharmaLaxalt;
